import { ListFormData, PeopleListsState } from "./ListsSlice";

const API_URL = "http://localhost:3000/api/v1/people";

export async function fetchPeopleLists() {
    return fetch(`${API_URL}.json`, {
        method: "GET",
        headers: {
            "Content-Type": "application/json",
        },
    }).then((res) => res.json())
    .catch((error) => {
        console.log("Error: ", error);
        return {} as PeopleListsState;
    });
}

export async function createPeopleList(payload: ListFormData) {
    return fetch(`${API_URL}.json`, {
        method: "POST",
        headers: {
            "Content-Type": "application/json",
        },
        body: JSON.stringify(payload.list)
    }).then((res) => res.json())
    .catch((error) => {
        console.log("Error: ", error);
        return {} as PeopleListsState;
    });
}
